equation
	// Limits
	Prio2act = Selfix(Balanced(), 0, Select(FRT_active, Prio2_FRT, Prio2));
	i1_max   = Selfix(Balanced(), i_max,  max(0.0, Select(Prio2act, i_max  * abs(i1_ref_in) / max(0.00000001, abs(i1_ref_in) + abs(i2_ref_in)), i_max)));
	i1P_max  = Selfix(Balanced(), iP_max, max(0.0, Select(Prio2act, iP_max * abs(i1P_ref)   / max(0.00000001, abs(i1P_ref)   + abs(i2P_ref))  , iP_max)));
	i1Q_max  = Selfix(Balanced(), iQ_max, max(0.0, Select(Prio2act, iQ_max * abs(i1Q_ref)   / max(0.00000001, abs(i1Q_ref)   + abs(i2Q_ref))  , iQ_max)));
	i2_max   = Selfix(Balanced(), i_max,  max(0.0, Select(Prio2act, i_max  * abs(i2_ref_in) / max(0.00000001, abs(i1_ref_in) + abs(i2_ref_in)), i_max  - abs(i1_ref_out))));
	i2P_max  = Selfix(Balanced(), iP_max, max(0.0, Select(Prio2act, iP_max * abs(i2P_ref)   / max(0.00000001, abs(i1P_ref)   + abs(i2P_ref))  , iP_max - abs(i1d_ref))));
	i2Q_max  = Selfix(Balanced(), iQ_max, max(0.0, Select(Prio2act, iQ_max * abs(i2Q_ref)   / max(0.00000001, abs(i1Q_ref)   + abs(i2Q_ref))  , iQ_max - abs(i1q_ref))));

	// FRT flag for active and post FRT
	FRT_post = Picdro(Flipflop(FRT_active and (not pre(FRT_active)),  not FRT_active)-0.499, 0.0, 100/max(0.000001, diP_max_frt));

	// Soft start flag
	soft_flagP = Picdro(Flipflop((soft_auto or soft_manually) and ( not pre(soft_auto or soft_manually)),  not (soft_auto or soft_manually))-0.499, 0.0, 100/max(0.000001, diP_max_soft));
	soft_flagQ = Picdro(Flipflop((soft_auto or soft_manually) and ( not pre(soft_auto or soft_manually)),  not (soft_auto or soft_manually))-0.499, 0.0, 100/max(0.000001, diQ_max_soft));

	// Positive sequence
	i1_ref_in  = sqrt((i1P_ref)^2+(i1Q_ref)^2);
	i1_ref_ltd = min(i1_ref_in, i1_max);
	// Priority on active current iP:
	i1d_prioP = max(-i1P_max,min(i1P_max,i1P_ref));
	i1q_prioP = max(-sqrt(max(0.0,Sqr(i1_max)-Sqr(i1d_prioP))),min(sqrt(max(0.0,Sqr(i1_max)-Sqr(i1d_prioP))),i1q_prioQ));
	// Priority on reactive current iQ:
	i1d_prioQ = max(-sqrt(max(0.0,Sqr(i1_max)-Sqr(i1q_prioQ))),min(sqrt(max(0.0,Sqr(i1_max)-Sqr(i1q_prioQ))),i1d_prioP));
	i1q_prioQ = max(-i1Q_max,min(i1Q_max,-i1Q_ref));
	// Priority on ratio iP/iQ:
	i1d_prioRatio =  i1P_ref*max(0.00000001,i1_ref_ltd)/max(0.00000001,i1_ref_in);
	i1q_prioRatio = -i1Q_ref*max(0.00000001,i1_ref_ltd)/max(0.00000001,i1_ref_in);
	// Output:
	i1d_ref = Select(i1P_ref>0.000001, Select(blocked, 0.0, Select(FRT_active, GradLim(Select(i1P_ref>0.000001,Selfix(PrioQ_FRT>1.5,i1d_prioRatio,Selfix(PrioQ_FRT,i1d_prioQ,i1d_prioP)),0.0),-99999,diP_max_frt/100), Select(FRT_post, GradLim(Select(i1P_ref>0.000001,Selfix(PrioQ>1.5,i1d_prioRatio,Selfix(PrioQ,i1d_prioQ,i1d_prioP)),0.0),-99999,diP_max_frt/100), Select(soft_flagP, GradLim(Select(i1P_ref>0.000001,Selfix(PrioQ>1.5,i1d_prioRatio,Selfix(PrioQ,i1d_prioQ,i1d_prioP)),0.0),-99999,diP_max_soft/100), GradLim(Select(i1P_ref>0.000001,Selfix(PrioQ>1.5,i1d_prioRatio,Selfix(PrioQ,i1d_prioQ,i1d_prioP)),0.0),-99999,diP_max/100))))),Select(i1P_ref<-0.000001,  Select(blocked, 0.0,   Select(FRT_active, GradLim(Select(i1P_ref<-0.000001,Selfix(PrioQ_FRT>1.5,i1d_prioRatio,Selfix(PrioQ_FRT,i1d_prioQ,i1d_prioP)),0.0),-diP_max_frt/100,99999), Select(FRT_post,GradLim(Select(i1P_ref<-0.000001,Selfix(PrioQ>1.5,i1d_prioRatio,Selfix(PrioQ,i1d_prioQ,i1d_prioP)),0.0),-diP_max_frt/100,99999), Select(soft_flagP,GradLim(Select(i1P_ref<-0.000001,Selfix(PrioQ>1.5,i1d_prioRatio,Selfix(PrioQ,i1d_prioQ,i1d_prioP)),0.0),-diP_max_soft/100,99999),GradLim(Select(i1P_ref<-0.000001,Selfix(PrioQ>1.5,i1d_prioRatio,Selfix(PrioQ,i1d_prioQ,i1d_prioP)),0.0),-diP_max/100,99999))))),Select(blocked, 0.0, Select(FRT_active,Selfix(PrioQ_FRT>1.5, i1d_prioRatio, Selfix(PrioQ_FRT, i1d_prioQ, i1d_prioP)),Selfix(PrioQ>1.5, i1d_prioRatio, Selfix(PrioQ, i1d_prioQ, i1d_prioP))))));

	i1q_ref = Select(blocked, 0.0, Select(FRT_active, Selfix(PrioQ_FRT>1.5, i1q_prioRatio, Selfix(PrioQ_FRT, i1q_prioQ, i1q_prioP)), Select(soft_flagQ, Select(i1Q_ref<-0.000001, GradLim(Select(i1Q_ref<-0.000001,Selfix(PrioQ>1.5,i1q_prioRatio,Selfix(PrioQ,i1q_prioQ,i1q_prioP)),0.0),-99999,diQ_max_soft/100), Select(i1Q_ref>0.000001, GradLim(Select(i1Q_ref>0.000001,Selfix(PrioQ>1.5,i1q_prioRatio,Selfix(PrioQ,i1q_prioQ,i1q_prioP)),0.0),-diQ_max_soft/100,99999), Selfix(PrioQ>1.5, i1q_prioRatio, Selfix(PrioQ, i1q_prioQ, i1q_prioP)))), Selfix(PrioQ>1.5, i1q_prioRatio, Selfix(PrioQ, i1q_prioQ, i1q_prioP)))));

	i1_ref_out = sqrt(max(0.0,Sqr(i1d_ref)+Sqr(i1q_ref)));

	i_ref_out = Selfix(Balanced(), i1_ref_out, i1_ref_out+i2_ref_out);
	if (i_ref_out>i_max+0.00001) then
		print("Current reference output exceeds maximum limit: i_ref_out=i_ref_out > i_max=i_max");
	end if;"

	// Negative sequence
	i2_ref_in  = Selfix(Balanced(), 0.0, sqrt(Sqr(i2P_ref)+Sqr(i2Q_ref)));
	i2_ref_ltd = Selfix(Balanced(), 0.0, min(i2_ref_in, i2_max));
	// Priority on active current iP:
	i2d_prioP = Selfix(Balanced(), 0.0, max(-i2P_max,min(i2P_max,i2P_ref)));
	i2q_prioP = Selfix(Balanced(), 0.0, max(-sqrt(max(0.0,Sqr(i2_max)-Sqr(i2d_prioP))),min(sqrt(max(0.0,Sqr(i2_max)-Sqr(i2d_prioP))),i2q_prioQ)));
	// Priority on reactive current iQ:
	i2d_prioQ = Selfix(Balanced(), 0.0, max(-sqrt(max(0.0,Sqr(i2_max)-Sqr(i2q_prioQ))),min(sqrt(max(0.0,Sqr(i2_max)-Sqr(i2q_prioQ))),i2d_prioP)));
	i2q_prioQ = Selfix(Balanced(), 0.0, max(-i2Q_max,min(i2Q_max,-i2Q_ref)));
	// Priority on ratio iP/iQ:
	i2d_prioRatio = Selfix(Balanced(), 0.0,  i2P_ref*max(0.00000001,i2_ref_ltd)/max(0.00000001,i2_ref_in));
	i2q_prioRatio = Selfix(Balanced(), 0.0, -i2Q_ref*max(0.00000001,i2_ref_ltd)/max(0.00000001,i2_ref_in));
	// Output:
i2d_ref = Selfix(Balanced(), 0.0, Select(i2P_ref>0.000001, Select(blocked, 0.0, Select(FRT_active, GradLim(Select(i2P_ref>0.000001,Selfix(PrioQ_FRT>1.5,i2d_prioRatio,Selfix(PrioQ_FRT,i2d_prioQ,i2d_prioP)),0.0),-99999,diP_max_frt/100), Select(FRT_post, GradLim(Select(i2P_ref>0.000001,Selfix(PrioQ>1.5,i2d_prioRatio,Selfix(PrioQ,i2d_prioQ,i2d_prioP)),0.0),-99999,diP_max_frt/100), Select(soft_flagP, GradLim(Select(i2P_ref>0.000001,Selfix(PrioQ>1.5,i2d_prioRatio,Selfix(PrioQ,i2d_prioQ,i2d_prioP)),0.0),-99999,diP_max_soft/100), GradLim(Select(i2P_ref>0.000001,Selfix(PrioQ>1.5,i2d_prioRatio,Selfix(PrioQ,i2d_prioQ,i2d_prioP)),0.0),-99999,diP_max/100))))), Select(i2P_ref<-0.000001, Select(blocked, 0.0,  Select(FRT_active, GradLim(Select(i2P_ref<-0.000001,Selfix(PrioQ_FRT>1.5,i2d_prioRatio,Selfix(PrioQ_FRT,i2d_prioQ,i2d_prioP)),0.0),-diP_max_frt/100,99999), Select(FRT_post, GradLim(Select(i2P_ref<-0.000001,Selfix(PrioQ>1.5,i2d_prioRatio,Selfix(PrioQ,i2d_prioQ,i2d_prioP)),0.0),-diP_max_frt/100,99999), Select(soft_flagP, GradLim(Select(i2P_ref<-0.000001,Selfix(PrioQ>1.5,i2d_prioRatio,Selfix(PrioQ,i2d_prioQ,i2d_prioP)),0.0),-diP_max_soft/100,99999), GradLim(Select(i2P_ref<-0.000001,Selfix(PrioQ>1.5,i2d_prioRatio,Selfix(PrioQ,i2d_prioQ,i2d_prioP)),0.0),-diP_max/100,99999))))), Select(blocked, 0.0,  Select(FRT_active, Selfix(PrioQ_FRT>1.5, i2d_prioRatio, Selfix(PrioQ_FRT, i2d_prioQ, i2d_prioP)), Selfix(PrioQ>1.5, i2d_prioRatio, Selfix(PrioQ, i2d_prioQ, i2d_prioP)))))));
i2q_ref = Selfix(Balanced(), 0.0, Select(blocked, 0.0, Select(FRT_active, Selfix(PrioQ_FRT>1.5, i2q_prioRatio, Selfix(PrioQ_FRT, i2q_prioQ, i2q_prioP)), Select(soft_flagQ, Select(i2Q_ref<-0.000001, GradLim(Select(i2Q_ref<-0.000001,Selfix(PrioQ>1.5,i2q_prioRatio,Selfix(PrioQ,i2q_prioQ,i2q_prioP)),0.0),-99999,diQ_max_soft/100), Select(i2Q_ref>0.000001, GradLim(Select(i2Q_ref>0.000001,Selfix(PrioQ>1.5,i2q_prioRatio,Selfix(PrioQ,i2q_prioQ,i2q_prioP)),0.0),-diQ_max_soft/100,99999), Selfix(PrioQ>1.5, i2q_prioRatio, Selfix(PrioQ, i2q_prioQ, i2q_prioP)))), Selfix(PrioQ>1.5, i2q_prioRatio, Selfix(PrioQ, i2q_prioQ, i2q_prioP))))));

	i2_ref_out = Selfix(Balanced(), 0.0, sqrt(max(0.0,Sqr(i2d_ref)+Sqr(i2q_ref))));

	// Additional flags:
	blocked = Picdro(block-0.4999, 0.000, 0.001);

	i1P_in_limit = Picdro(abs(i1P_ref)-abs(i1d_ref)+0.499, 0.005, 0.001);
	i1Q_in_limit = Picdro(abs(i1Q_ref)-abs(i1q_ref)+0.499, 0.005, 0.001);
	i2P_in_limit = Selfix(Balanced(),0,Picdro(Selfix(Balanced(),0,abs(i1P_ref)-abs(i1d_ref)+0.499), 0.005, 0.001));
	i2Q_in_limit = Selfix(Balanced(),0,Picdro(Selfix(Balanced(),0,abs(i1Q_ref)-abs(i1q_ref)+0.499), 0.005, 0.001));

end Current_Limiter_Iref_Limiter;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Balanced
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for balanced RMS, 2 for unbalanced RMS, 3 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end Balanced;

function Picdro
	input Boolean boolexpr;
	input Real Tpick;
	input Real Tdrop;
	output Boolean varA;
algorithm
	if boolexpr = true then
		varA = delay(1,Tpick);
	else if boolexpr = false then
		varA = delay(0,Tdrop);
	else
		varA = pre(varA)
	end if;
end Picdro;

function Flipflop
	input  Boolean boolset;
	input  Boolean boolreset;
	output Boolean state;
algorithm
	if (boolset = true) and (boolreset = false) then
		state := true;
	end if;
	if (boolset = false) and (boolreset = true) then
		state := false;
	end if;	
end Flipflop;

function Sqr
	input Real x;
	output Real y;
algorithm
	y = x*x;
end Selfix;

function GradLim
	input Real inputSignal;
	input Real minGradient;
	input Real maxGradient;
	output Real outputSignal;
algorithm
	if der(inputSignal) > maxGradient then
		outputSignal = maxGradient+inputSignal;
	else if der(inputSignal) < minGradient then
		outputSignal = minGradient+inputSignal;
	else
		outputSignal = inputSignal+der(inputSignal);
	end if;
end GradLim;

cim:FunctionDescriptor.cim:FunctionDescriptor.initialConditions:
Boolean FRT_active (start = 0);
Boolean block;
if noEvent(abs(block))) < 1e-6 then
    block = 0;
end if;
Boolean soft;
if noEvent(abs(soft))) < 1e-6 then
    soft = 0;
end if;
Boolean soft_manually (start = 0);
Boolean blocked (start =  block);
Real i1P_ref (start = Selfix(block, 0.0,  i1d_ref));
Real i1Q_ref (start =  Selfix(block, 0.0, -i1q_ref);
Real i2P_ref (start = Selfix(Balanced(),0, Selfix(block, 0.0,  i2d_ref)));
Real i2Q_ref (start = Selfix(Balanced(),0, Selfix(block, 0.0, -i2q_ref)));
Real i2d_ref;
if noEvent(abs(i2d_ref))) < 1e-6 then
    i2d_ref = 0;
end if;
Real i2q_ref;
if noEvent(abs(i2q_ref))) < 1e-6 then
    i2q_ref = 0;
end if;
Real i1P_in_limit (start = 0);
Real i1Q_in_limit (start = 0);
Real i2P_in_limit (start = 0);
Real i2Q_in_limit (start = 0);
